import { LinkButtonSmall } from '../styles/Link'

import styled from 'styled-components'

const ButtonElement = styled(LinkButtonSmall)`
    // font-size: 20px;
    // font-weight: 500
    // letter-spacing: .25px;
    background-color: #eb3323;
    // width: 100px;
    // height: 20px;
    // border-radius: 4px;



`;

const Button = (props) => (
    <ButtonElement  {...props} >{props.name}</ButtonElement>
);

export { Button };
